import React from 'react';
import {useParams} from "react-router-dom";

interface PropsType {
    id:string;
}

const FolderInfo:React.FC<PropsType> = (props) => {
    const params = useParams();

    return (
        <div>
            {params.id}
        </div>
    );
};

export default FolderInfo;
